class Solution {

    /**
     * @param Integer[] $nums1
     * @param Integer[] $nums2
     * @return Integer
     */
    function minOperations($nums1, $nums2) {
        $n = count($nums1);
        // Calculate initial maximums
        $maxNums1 = max($nums1);
        $maxNums2 = max($nums2);

        // If already in correct state, no operations needed.
        if ($nums1[$n - 1] == $maxNums1 && $nums2[$n - 1] == $maxNums2) {
            return 0;
        }

        // If swapping the last elements satisfies the condition
        if (($nums1[$n - 1] < $maxNums2 && $nums2[$n - 1] < $maxNums1) || 
            ($nums1[$n - 1] < $maxNums2 && $nums2[$n - 1] == $maxNums2) ||
            ($nums2[$n - 1] < $maxNums1 && $nums1[$n - 1] == $maxNums1)) {
            return 1;
        }

        // Check if swapping any pair of elements can satisfy the condition
        for ($i = 0; $i < $n - 1; $i++) {
            if (($nums1[$i] == $maxNums2 && $nums2[$i] < $nums1[$n - 1]) ||
                ($nums2[$i] == $maxNums1 && $nums1[$i] < $nums2[$n - 1])) {
                return 1;
            }
        }

        // If conditions cannot be satisfied
        return -1;
    }
}
